import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav>
            <ul>
                <li>
                    <Link to="/">Главная</Link>
                </li>
                <li>
                    <Link to="/create-session">Создать Сессию</Link>
                </li>
                <li>
                    <Link to="/join-session">Присоединиться к Сессии</Link>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
